import { Box, Button } from '@mui/material';
import React from 'react';
import {FormControl,TextField} from '@mui/material';
import { makeStyles } from '@mui/styles';

const style = makeStyles({
  button:{
    color:'red'
  },
  label:{
    padding:'20px',
    position:'absolute',
    cursor:'text'
  },
  form:{
    display:'flex',
    flexDirection:'column',
    alignItems:'center',
    justifyContent:'center'
  },
  inputBox:{
    width:'200px',
    padding:'20px',
    '&:focus':{
      top:'50px'
    }
  },
  inputGroup:{
    position:'relative'
  },

})

export default function SignupComponent() {
  const classes = style()
  return (
   <div>
    <form className={classes.form}>
      <div className={classes.inputGroup}>
      <label className={classes.label}>Name</label><input type="text" className={classes.inputBox}></input></div>
      <div className={classes.inputGroup}><label className={classes.label}>Password</label><input type='password' className={classes.inputBox}></input>
      </div><div className={classes.inputGroup}> <label className={classes.label}>Mobile Number</label><input type='tel' className={classes.inputBox}></input></div>
      <button type='submit' className={classes.button}>Submit</button>
    </form>
   </div>
  )
}
